  CREATE OR REPLACE EDITIONABLE PROCEDURE "C##QUANLYHOCSINH"."SelectScore" 
  (
  StudentCode in nvarchar2,
  StudentName in  nvarchar2,
  StudentClass in varchar2,
  SubjectName in nvarchar2,
  SchoolYear in varchar2,
  SemmesterA in NUMBER 
  ) 
  is
BEGIN  
  select MSHOCSINH, STUDENT.NAME as "tên", SUBJECT.NAME as "tên môn",
  Mieng.SCORES as "Miệng", MuoiLam.SCORES as "15p",
  MotTiet.SCORES as "45p", GiuaKy.SCORES as "Giữa kỳ",
  CuoiKy.SCORES as "Cuối kỳ"
  from STUDENT inner join STUDENTINCLASS
  on STUDENT.MSHOCSINH = STUDENTINCLASS.MSHOCSINH inner join TESTSCORES Mieng 
  on STUDENTINCLASS.MSHOCSINH = Mieng.MSHOCSINH inner join TESTSCORES MuoiLam
  on STUDENTINCLASS.MSHOCSINH = MuoiLam.MSHOCSINH inner join TESTSCORES MotTiet
  on STUDENTINCLASS.MSHOCSINH = MotTiet.MSHOCSINH inner join TESTSCORES GiuaKy
  on STUDENTINCLASS.MSHOCSINH = GiuaKy.MSHOCSINH inner join TESTSCORES CuoiKy
  on STUDENTINCLASS.MSHOCSINH = CuoiKy.MSHOCSINH inner join SUBJECT
  on Mieng.SUBJECTID = SUBJECT.SUBJECTID  inner join SEMESTER
  on Mieng.SEMESTERID = SEMESTER.SEMESTERID
  where(
  ((StudentCode = STUDENT.MSHOCSINH) or (StudentName = STUDENT.NAME ))
  and(StudentClass = STUDENTINCLASS.IDCLASS) 
  and(SubjectName = SUBJECT.NAME)
  and(SchoolYear = STUDENTINCLASS.SCHOOLYEARID)
  and(SemmesterA = SEMESTER.SEMESTERID)
  and(Mieng.TYPESCORESID = "Mieng")
  and(MuoiLam.TYPESCORESID = "15p")
  and(MotTiet.TYPESCORESID = "45p")
  and(GiuaKy.TYPESCORESID = "GiuaKy")
  and(CuoiKy.TYPESCORESID = "CuoiKy")
  );
end;

